description:
As the subtle underlying sexual tones of her voice echoed the room the mysteriousness of the shadowy man sat watching.
His charismatic Charm swept her of her feet and took her to a place only her heart had dreamt of.
From the darker side of Kendo a mysterious and sexually powerful film 

starring: Valery Summer, Sasha Steele, Sasha, Michelle Moist, Tiffany Kingston and Keisha Kane.



